import React from 'react';

import './userInput.css';

const UserInput = (props) => {
  return (
    <label>
      <h4 className='inputName'>{props.title}</h4>
      <input
        type={props.type}
        name={props.name}
        placeholder={props.placeholder}
      />
    </label>
  );
};

export default UserInput;
